window.MarketLive = window.MarketLive || {};
MarketLive.P2P = MarketLive.P2P || {};
(function(ns) {  
	/**
	This method validates qty entered to make sure that the user does not enter
	a value greater than what is available in stock.  If the value entered by
	the user is greater than what is available, the qty will automatically set
	to the max qty available for this SKU
	*/  
    ns.validateQty= function(stock, backorderStock, optionSize, currentOption, enteredQty, productPk){
    	var qty = enteredQty;
    	var availableQty = stock + backorderStock;
    	if(availableQty < 0){
    		availableQty = 0;
    	}
    	
    	var selectedOption = jQuery('#'+productPk).find(":selected").val();
    	if (!ns.stockIsAllDigits(enteredQty) || enteredQty < 0){
    		qty = 0;
    	}
    	else if(optionSize > 0 && selectedOption !== undefined
    		&& (currentOption !== selectedOption)){
    		//has option and the current option is not the same as
    		// the selected option,  then do not auto adjust qty
    		qty = enteredQty;
    		
    		$.ajax({
    			type: "POST",
    	        async: false,
    			url: "/stockAvailabilityUpdate.do?method=getQtyAvailable&r="+ Math.random(),
    			data: {form:$("#mainForm").serialize(),"qty":qty, "optionSelected": selectedOption,'productPk':productPk},
    			dataType: "json",
    			success: function(response){
    				qty = response.qtyvalue;
    			},
    			error: function(e){
    				var errorValue = "error";
    			}
    		});
    	}
    	else{
    		//check if qty is availabile
    		if(enteredQty > availableQty ){
    			qty= availableQty;
    		}
    	}
    	
    	return qty;
    }
    
    /**
    This method validates the selected option and the qty entered.  If Qty
    is greater than available for the selected option, the qty will 
    be automatically set to the max qty available 
    */
 	ns.validateOptionAndQty= function(productPk){
 		var qty = $('#'+productPk+'_qty').val();
 		var optionSelected = $('#'+productPk).find(":selected").val();
 		
 		if(optionSelected !== undefined){
 			$.ajax({
    			type: "POST",
    	        async: false,
    			url: "/stockAvailabilityUpdate.do?method=getQtyAvailable&r="+ Math.random(),
    			data: {form:$("#mainForm").serialize(),"qty":qty,"optionSelected": optionSelected,'productPk':productPk},
    			dataType: "json",
    			success: function(response){
    				//set the qty field
    				if(qty != response.qtyvalue){
    					$('#'+productPk+'_qty').val(response.qtyvalue);
    				}
    				
    			},
    			error: function(e){
    				var errorValue = "error";
    			}
    		});
 		}	
 	}
 	
    ns.validateQtyPickUpInStore = function(stock, optionSize, currentOption, enteredQty,productPk){
    	var qty = enteredQty;
    	var availableQty = stock;
    	if(availableQty < 0){
    		availableQty = 0;
    	}
    	
    	var selectedOption = jQuery('#'+productPk).find(":selected").val();
    	if (!ns.stockIsAllDigits(enteredQty) || enteredQty < 0){
    		qty = 0;
    	}
    	else if(optionSize > 0  && selectedOption !== undefined
    		&& (currentOption !== selectedOption)){
    		//has option and the current option is not the same as
    		// the selection option are not the same then do not auto adjust qty
    		qty = enteredQty;
    	}
    	else{
    		//check if qty is availabile
    		if(enteredQty > availableQty ){
    			qty= availableQty;
    		}
    	}
    	
    	return qty;
    }

})(MarketLive.P2P);